    false,nt"url": null,nt"notes": "This Fire Management Review for St. Vincent
    National Wildlife Refuge covers habitat management including: open sand ridges,
    marshes, pine flatwoods, scrub, and oak type habitats.  Prescribed burn plans are
    discussed for each of these habitat types.  Wildlife population management is also
    discussed.  Fire management- including prescribed fire planning, wildfire readiness,
    qualifications/training, safety, and fire cache- is outlined.  Fire suppression
    equipment available at the refuge is also listed.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
